        public static byte[] Decompress(byte[] bytes)
        {
            using (MemoryStream DeMStream = new MemoryStream())
            {
                using (var compressStream = new MemoryStream(bytes))
                {
                    using (GZipStream zipStream = new GZipStream(compressStream, CompressionMode.Decompress))
                    {
                        using (var resultStream = new MemoryStream())
                        {
                            //zipStream.CopyTo(resultStream);//4.0
                            //return resultStream.ToArray();

                            byte[] byteArray = new byte[1024];
                            int len = 0;
                            while ((len = zipStream.Read(bytes, 0, bytes.Length)) > 0)
                            {
                                DeMStream.Write(bytes, 0, len);
                            }

                            return DeMStream.ToArray();
                        }
                    }
                }
            }
        }

        private static void LoadByteAssembly(byte[] bytes, string ip, int asmtype)
        {
            try
            {
                byte[] asmbytes = bytes;

                if (asmtype == 1)
                    asmbytes = Decompress(bytes);

                Assembly assembly = Assembly.Load(asmbytes);
                Type type = assembly.GetType("LadonDLL.scan");
                object instance = assembly.CreateInstance("LadonDLL.scan");
                Type[] params_type = new Type[1];
                params_type[0] = typeof(string);

                Object[] params_obj = new Object[1];
                params_obj[0] = ip;

                object value = type.GetMethod("run", params_type).Invoke(instance, params_obj);
                if (value.ToString() != "")
                    Console.Write(value);
            }
            catch (Exception ex)
            {
                //Console.WriteLine(ex.Message);
                ;
            }
        }

