                {
                    Aping(ip.Replace("/8", ""));
                }
                else if (ip.Contains("/16"))
                {
                    Bping(ip.Replace("/16", ""));
                }
                else if (ip.Contains("/24"))
                    Cping(ip.Replace("/24", ""));
                else
                    ScanPC(ip);
            }
            else
            {
                //if (ip.Contains("http:") || ip.Contains("https:"))
                if (ip.Contains(":")) 
                    NoScanPC(ip);
                else if (ip.Contains("/8"))
                {
                    Aping(ip.Replace("/8", ""));
                }
                else if (ip.Contains("/16"))
                {
                    Bping(ip.Replace("/16", ""));
                }
                else if (ip.Contains("/24"))
                    Cping(ip.Replace("/24", ""));
                else
                    NoScanPC(ip);
            }


        }

