        private static void cpingCmd(string ip, string argStr)
        {
            if (ip.ToLower().Contains("http"))
            {
                if (argStr.Contains("http://$ip$") || argStr.Contains("https://$ip$"))
                {
                    ip = ip.Replace("http://", "");
                    ip = ip.Replace("https://", "");
                }
            }

            //Console.WriteLine("IP: "+ip);
            if (argStr.Contains("$ip$"))
                argStr = argStr.Replace("$ip$", ip);
            else
                argStr = (ip + " " + argStr);

            ////加强版S扫描器有问题,运行多个会崩溃,所以调用无结果
            Process p = new Process();
            p.StartInfo.FileName = callExeName;
            p.StartInfo.Arguments = argStr;
            p.StartInfo.UseShellExecute = false;
            p.StartInfo.RedirectStandardInput = true;
            p.StartInfo.RedirectStandardOutput = true;
            p.StartInfo.RedirectStandardError = true;
            p.StartInfo.CreateNoWindow = true;
            p.Start();


            //p.StandardInput.WriteLine(argStr);

            p.StandardInput.AutoFlush = true;

            string strOuput = p.StandardOutput.ReadToEnd();
            p.WaitForExit();
            p.Close();

            if (strOuput.Trim().Length != 0)
            {
                Console.WriteLine(strOuput);//noip
                //Console.WriteLine("IP: " + ip + "\r\n" + strOuput);
            }


        }

        private static void LoadDiyNetDLL(string dll, string ip)
        {
            try
            {

                Assembly assembly = Assembly.LoadFile(AppDomain.CurrentDomain.BaseDirectory + dll);
                Type type = assembly.GetType("LadonDLL.scan");
                object instance = assembly.CreateInstance("LadonDLL.scan");

                Type[] params_type = new Type[1];
                params_type[0] = typeof(string);

                Object[] params_obj = new Object[1];
                params_obj[0] = ip;

                object value = type.GetMethod("run", params_type).Invoke(instance, params_obj);

                Console.Write(value);

            }
            catch (Exception ex)
            {
                //Console.WriteLine(ex.Message);
            }
        }

