                Assembly Assembly = Assembly.LoadFrom(path);
                MethodInfo info = Assembly.EntryPoint;
                ParameterInfo[] parameters = info.GetParameters();
                info.Invoke(null, new object[] { new string[] { ip } });

            }
            catch (Exception)
