        private static void LoadDiyINI(string ini)
        {
            callExeName = IniReadValue("Ladon", "exe", Environment.CurrentDirectory + "\\" + ini);
            scanArgStr = IniReadValue("Ladon", "arg", Environment.CurrentDirectory + "\\" + ini);

            if (!File.Exists(callExeName))
                if (File.Exists(@"C:\WINDOWS\system32\" + callExeName))
                    callExeName = @"C:\WINDOWS\system32\" + callExeName;
                else
                {
                    Console.WriteLine("Not Found " + callExeName);
                    return;
                }

            if (scanArgStr.Trim() == "" || !scanArgStr.Contains("$ip$"))
            {
                Console.WriteLine("error: Ladon.ini arg value need include $ip$!");
                return;
            }
        }
        private static void LoadDiyPS1(string ps1, string ip)
        {
            if (!File.Exists(ps1))
                return;
            string script = File.ReadAllText(ps1);
            if (script.Trim() == "")
                return;
            try
            {
                using (Runspace runspace = RunspaceFactory.CreateRunspace())
                {
                    runspace.Open();

                    PowerShell ps = PowerShell.Create();
                    ps.Runspace = runspace;
                    ps.AddScript(script);
                    ps.Invoke();

                    ps.AddCommand("Ladon").AddParameters(

                        new Dictionary<string, string>()
             {
                 //{"ip", "127.0.0.1"}
                 {"ip", ip}
             }
                    );

                    foreach (PSObject result in ps.Invoke())
                    {
                        Console.WriteLine(result);
                    }

                }
            }
            catch (Exception)
            {
                ;
            }
        }


